  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, John William and BUSBY, Sarah
  WILLIAMS, John William (Jack) and WILLIAMSON, Jessie Mackie
  JWILLIAMS, Nancy Mary and CACCIA-BIRCH, Anthony William Fabio (Tony)
  JCACCIA-BIRCH, Julian Mario and HALLING, Ruth Ann
  CACCIA-BIRCH, Julian Mario and HALLING, Ruth Ann (cont...)
  the USA where they settled in Ames, Iowa. Julian has a carpentry business and Ruth teaches piano and
  works as a secretary. They are members of the United Methodist Church and enjoy reading, photography,
  gardening, hiking, travel and following the pursuits of their daughters.
  01> CACCIA-BIRCH, Anna Greta
  b 26.02.1977
  Anna b. at Middle Swan near Perth, Western Australia. She is a student at Vanderbilt University in
  Nashville, Tennessee, USA (1994-98) where she is completing a Bachelor of Engineering degree in
  Biomedical Engineering.
  02> CACCIA-BIRCH, Rebecca Lee
  b 10.08.1978
  Rebecca b. at Middle Swan near Perth, Western Australia. She is a student at Loyola University of
  Chicago in Chicago, Illinois, USA, where she is studying graphic design.
  05> CACCIA-BIRCH, Virginia Rose m on 06.01.1965 to (1)BERENS, Richard Wilfred
  Beauvoir
  b 18.10.1940
  b 18.02.1934
  Virginia b. at Marton, NZ, and m, at Westminster, UK. Divorced. Richard, s/o Herbert Cecil Benyon
  Berens and Moira Nancy Green. Virginia was educated at Nga Tawa School, Marton.
  Richard was educated at Eton and, after serving in the army, joined the Daily Telegraph newspaper. He
  later became editor of the Daily Express diary (the William Hickey Column). He now lives in Oxfordshire
  and is a freelance public relations officer.
  01> BERENS, Camilla Nancy
  b 05.10.1965
  Camilla b, at Hammersmith, London. Address: 100 Manor Avenue, Brockley, London SE4 1TE, England.
  Camilla was educated at Godolphin and Latymer School, Hammersmith and went on to study Journalism
  at the London College of Printing. In her mid-20s, she edited and produced her own magazine called
  "Pod", and is now a freelance journalist and writer specialising in environmental issues and youth
  culture. She still enjoys anything out of the ordinary and although she doesn't like to admit it,
  she's a bit of a hippy at heart.
  05> CACCIA-BIRCH, Virginia Rose m on 21.09.1971 to (2) FORTESCUE, Mark Charles
  Grenville (Billy)
  b 18.10.1940
  b 06.03.1947 d 25.11.1982
  Virginia m, at Chelsea, London. Mark, slo Brigadier Arthur Grenville Fortescue and Rosita Campbell.
  Address: Church House, Steeple Ashton, Trowbridge, Wiltshire BA14 6HH, UK.
  Virginia is a financial consultant with Allied Dunbar in Bath.
  Billy was educated at Eton, and at Grenoble and Munich Universities. After qualifying as a Chartered
  Accountant he became a banker. He was an active member of the Honourable Artillery Company, the
  Regiment of the City of London. He was a keen helmsman.
  01> FORTESCUE, Sabina Thérèse
  b 23.09.1973
  Sabina b. at Hammersmith, London. She was a student at St Mary's, Calne, Wiltshire, then graduated
  BA(Hons) from Manchester University in 1997. She is currently at Guildford Law School.
